import './App.css';
import Header from "./Components/Header/Component";


function App() {
  return (
    <div className="App">
        <Header/>
        <main>
            <h2>Welcome to my little part of the Internet!</h2>
            <p>
                This website is currently under construction but I'm working hard to get everything running...
            </p>
        </main>
    </div>
  );
}

export default App;
